import React from "react";
import "../styles/Flat-equipments.css"


class EquipmentList extends React.Component {



    equipements = this.props.flat.equipements;

    render() {
        return <div className="flat__equipments">
            <ul>
            {this.equipements.map((equipement) =>
                <li className="flat__equipments-content" key={equipement}> {equipement} </li>
            )}
            </ul>
        </div>
    }
}

export default EquipmentList
